def selection_sort(A): # Function selection sort
    selection_count=0 # สร้างตัวแปรเก็บจำนวนการเปรียบเทียบข้อมูลของ Selection sort
    for i in range (0,len(A) - 1):     
        minIndex = i
        for j in range (i+1,len(A)):
            selection_count+=1 # เมื่อเกิดการเปรียบเทียบข้อมูลก็จะบวกค่าของ selection_count ขึ้นทีละ 1
            if A[j] < A[minIndex]:
                minIndex = j          
        if minIndex != i:
            A[i],A[minIndex] = A[minIndex],A[i]
    return selection_count # Return ค่าที่นับได้จากการเปรียบเทียบข้อมูลของ Selection sort

def merge_sort(A): # Function merge sort
    global merge_count # สร้างตัวแปรเก็บจำนวนการเปรียบเทียบข้อมูลของ Merge sort เป็นแบบ global
    if len(A) >1: 
        mid = len(A)//2 
        L = A[:mid] 
        R = A[mid:]
        merge_sort(L) 
        merge_sort(R) 
        i = j = k = 0
        while i < len(L) and j < len(R): 
            if L[i] < R[j]: 
                A[k] = L[i] 
                i+=1
                merge_count+=1 # เมื่อเกิดการเปรียบเทียบข้อมูลก็จะบวกค่าของ merge_count ขึ้นทีละ 1
            else: 
                A[k] = R[j] 
                j+=1
                merge_count+=1 # เมื่อเกิดการเปรียบเทียบข้อมูลก็จะบวกค่าของ merge_count ขึ้นทีละ 1
            k+=1
        while i < len(L): 
            A[k] = L[i] 
            i+=1
            k+=1   
            merge_count+=1 # เมื่อเกิดการเปรียบเทียบข้อมูลก็จะบวกค่าของ merge_count ขึ้นทีละ 1
        while j < len(R): 
            A[k] = R[j] 
            j+=1
            k+=1
            merge_count+=1 # เมื่อเกิดการเปรียบเทียบข้อมูลก็จะบวกค่าของ merge_count ขึ้นทีละ 1
    return merge_count # Return ค่าที่นับได้จากการเปรียบเทียบข้อมูลของ Merge sort

